note_models.css:
.card {
    font-family: arial;
    font-size: 100px;
    text-align: center;
    color: black;
    background-color: white;
    margin: 0;
    padding: 0;

}

#answer {
    position: absolute;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    box-sizing: border-box;
    display: inline-block;
    min-width: 92%;
}

#kanji-container {
            width: 100%;
            height: 100vh;
            overflow: hidden;
            position: relative;
}


iframe
{
            width: 125%; /* Inverse of the scale factor */
            height: 125%; /* Inverse of the scale factor */
            transform: scale(0.8); /* Adjust the scale factor as needed */
            transform-origin: top left;
            border: none;
}
